INSERT INTO Translation VALUES('f1a2b3c4-1111-4567-890a-bcdef0123458','∫[a,b] f(x)dx = F(b) - F(a), where F''(x) = f(x)','∫[a,b] f(x)dx = F(b) - F(a), כאשר F''(x) = f(x)');
INSERT INTO Translation VALUES('f1a2b3c4-1111-4567-890a-bcdef0123459','∫[a,b] f(x)dx = F(a) - F(b), where F''(x) = f(x)','∫[a,b] f(x)dx = F(a) - F(b), כאשר F''(x) = f(x)');
INSERT INTO Translation VALUES('f1a2b3c4-1111-4567-890a-bcdef012345a','∫[a,b] f(x)dx = F(b) + F(a), where F''(x) = f(x)','∫[a,b] f(x)dx = F(b) + F(a), כאשר F''(x) = f(x)');
INSERT INTO Translation VALUES('f1a2b3c4-1111-4567-890a-bcdef012345b','∫[a,b] f(x)dx = F''(b) - F''(a), where F(x) is any function','∫[a,b] f(x)dx = F''(b) - F''(a), כאשר F(x) פונקציה כלשהי');
INSERT INTO Translation VALUES('f2a2b3c4-2222-4567-890a-bcdef0123456','Calculate ∫[0,2] x dx using the Fundamental Formula','חשב ∫[0,2] x dx באמצעות הנוסחה היסודית');
