INSERT INTO Translation VALUES('1a7c9510-7498-4c83-b135-be80383a9933','Does F(x,y)=y² - x have a differentiable solution y(x) near (0,0)','האם ל‑F(x,y)=y² - x יש פתרון y(x) נגזר בסביבת (0,0)');
INSERT INTO Translation VALUES('96c2ed26-f52c-4882-b069-f1cdd702351c','Does ln(x) + y = 0 require implicit differentiation to find dy/dx','האם ln(x) + y = 0 מחייב גזירה בסתר כדי למצוא dy/dx');
