INSERT INTO Translation VALUES('7fd20a5e-4ca6-4084-842d-d450283668b8','Does x² + y² = 0 define y as a function of x near x=0','האם x² + y² = 0 מגדירה את y כפונקציה של x בסביבת x=0');
INSERT INTO Translation VALUES('f849a09a-d365-4d31-bc5f-a847a105bf0b','In xy = 1, is dy/dx equal to -y/x','האם ב‑xy = 1 מתקבל dy/dx = -y/x');
