INSERT INTO Translation VALUES('fa13a683-48e2-40ef-9e68-6d6214818e8d','In the rule of Hypothetical Syllogism, if we have P → Q and Q → R, what can we conclude?','בכלל הסילוגיזם ההיפותטי, אם יש לנו P → Q ו-Q → R, מה נוכל להסיק?');
INSERT INTO Translation VALUES('8682f65b-3735-415e-b505-040032ac807f','Hypothetical Syllogism allows us to chain implications: from P → Q and Q → R, we can derive P → R. This is a transitive property of implication.','הסילוגיזם ההיפותטי מאפשר לנו לשרשר השלכות: מ-P → Q ו-Q → R, נוכל להסיק P → R. זוהי תכונה טרנזיטיבית של השלכה.');
INSERT INTO Translation VALUES('f1670c9e-22df-45c1-a5bd-8310d9df5ec4','P → R','P → R');
INSERT INTO Translation VALUES('4e8fbbb2-b1b9-4b47-8509-81c18eb8dc89','P ∧ Q','P ∧ Q');
