INSERT INTO Translation VALUES('3bc16876-4297-492f-abdd-64eccfa58b1d','What is the primary purpose of the Minimax algorithm?','מה המטרה העיקרית של אלגוריתם המינימקס?');
INSERT INTO Translation VALUES('fb61e999-e3c4-4049-9d99-e01dfe351973','The Minimax algorithm is designed to find the optimal strategy for two-player zero-sum games by minimizing the maximum possible loss.','אלגוריתם המינימקס נועד למצוא את האסטרטגיה האופטימלית למשחקים של שני שחקנים עם סכום אפס על ידי מזעור ההפסד המקסימלי האפשרי.');
INSERT INTO Translation VALUES('627c5243-f112-4ca3-b897-66a4aea55571','To find optimal strategies in two-player zero-sum games','למצוא אסטרטגיות אופטימליות במשחקים של שני שחקנים עם סכום אפס');
INSERT INTO Translation VALUES('094aa722-81ba-4d4a-baf0-19817db1d564','To sort arrays efficiently','למיין מערכים ביעילות');
INSERT INTO Translation VALUES('61cd7bf9-e13d-41b6-953c-2171c58ab187','To find shortest paths in graphs','למצוא נתיבים קצרים ביותר בגרפים');
