INSERT INTO Translation VALUES('96bafe31-8038-4afe-8b58-ecb0d93fb4e4','End the game quickly','לסיים את המשחק מהר');
INSERT INTO Translation VALUES('9d8b7ae5-02e5-4b66-8990-27eb107ba9ee','What is the time complexity of the basic Minimax algorithm for a game tree with branching factor b and depth d?','מה המורכבות הזמן של אלגוריתם המינימקס הבסיסי עבור עץ משחק עם גורם הסתעפות b ועומק d?');
INSERT INTO Translation VALUES('3cc204c4-09c9-4a40-9026-96002278d211','The Minimax algorithm explores all possible game states, resulting in O(b^d) time complexity, where b is branching factor and d is depth.','אלגוריתם המינימקס בוחן את כל מצבי המשחק האפשריים, מה שמביא למורכבות זמן של O(b^d), כאשר b הוא גורם ההסתעפות ו-d הוא העומק.');
