INSERT INTO Translation VALUES('7b1523ab-6cea-4381-916b-1d6d334b1726','Consistency implies satisfiability but not vice versa','עקביות גוררת ספיקות אבל לא להיפך');
INSERT INTO Translation VALUES('b173d7e9-3558-46f3-9706-2088519f1801','Define soundness in the context of formal proof systems.','הגדר נאותות בהקשר של מערכות הוכחה פורמליות.');
INSERT INTO Translation VALUES('9feafbf2-7588-4540-95e9-ebe11900c948','What does completeness mean for a logical system?','מה משמעות השלמות במערכת לוגית?');
INSERT INTO Translation VALUES('d5dd81b0-7db5-4720-a95b-a70c8ba9fc34','Every valid formula is provable in the system','כל נוסחה תקפה ניתנת להוכחה במערכת');
INSERT INTO Translation VALUES('cddcd716-687c-4567-94cf-e947339677eb','The system contains all possible formulas','המערכת מכילה את כל הנוסחאות האפשריות');
INSERT INTO Translation VALUES('c2d2831c-782a-463d-ad1b-9a864d652e37','If f(x) = sin(x), find f-prime(π/2) using the definition of derivative.','אם f(x) = sin(x), מצא את f-prime(π/2) באמצעות הגדרת הנגזרת.');
INSERT INTO Translation VALUES('b6fbf727-3742-48d5-a516-b7b61148ba58','State Rolles theorem and give one condition for its application.','נסח את משפט רול ותן תנאי אחד ליישומו.');
INSERT INTO Translation VALUES('a80a9b1e-cdba-4a8f-85fc-b6999d5eb330','A function f is monotone increasing on an interval if:','פונקציה f היא מונוטונית עולה על קטע אם:');
INSERT INTO Translation VALUES('f9fd0169-c173-4bf4-8d1f-46b9149ff748','For x1 < x2 in the interval, f(x1) <= f(x2)','עבור x1 < x2 בקטע, f(x1) <= f(x2)');
INSERT INTO Translation VALUES('4ad04e6e-5c92-4cbc-b7dd-0e2a68493d33','f-prime(x) > 0 for all x in the interval','f-prime(x) > 0 לכל x בקטע');
INSERT INTO Translation VALUES('d60d4f13-f239-4500-9d69-d34c2d19041a','What does the first derivative test tell us about critical points?','מה מבחן הנגזרת הראשונה מספר לנו על נקודות קיצון?');
INSERT INTO Translation VALUES('f932aa10-9057-42f0-bd7d-2f330b7fd8cf','It determines whether a critical point is a local maximum, minimum, or neither','הוא קובע אם נקודה קריטית היא מקסימום מקומי, מינימום, או לא אחד מאלה');
INSERT INTO Translation VALUES('cbecd3eb-eaaf-4517-91ce-6dd3b9692a7b','It finds all critical points of a function','הוא מוצא את כל הנקודות הקריטיות של פונקציה');
INSERT INTO Translation VALUES('b3918bad-0a40-44d5-9405-a72aa85f89b3','How does monotonicity relate to the derivative of a function?','איך מונוטוניות קשורה לנגזרת של פונקציה?');
INSERT INTO Translation VALUES('d923b9df-df4f-4d46-a6e2-1791d97f2855','If f-prime(x) > 0 on an interval, then f is increasing on that interval','אם f-prime(x) > 0 על קטע, אז f עולה על אותו קטע');
INSERT INTO Translation VALUES('7a406df5-f5f5-47a4-b139-23946deb633b','Monotonicity is unrelated to the derivative','מונוטוניות לא קשורה לנגזרת');
INSERT INTO Translation VALUES('f2b441e7-f96b-46f9-a8f3-704d730994b3','Describe the process of finding local extrema using derivatives.','תאר את התהליך למציאת קיצון מקומי באמצעות נגזרות.');
INSERT INTO Translation VALUES('f717d591-e870-4d5f-bc03-b64ecbc93506','What are the three types of asymptotes?','מהם שלושת סוגי האסימפטוטות?');
INSERT INTO Translation VALUES('89c5b071-0819-402a-b974-236baf0ac750','Vertical, horizontal, and oblique asymptotes','אסימפטוטות אנכיות, אופקיות ואלכסוניות');
INSERT INTO Translation VALUES('4d98b2b8-018c-4738-9e04-2150e03a74f7','Linear, quadratic, and cubic asymptotes','אסימפטוטות לינאריות, ריבועיות וקוביות');
INSERT INTO Translation VALUES('97447226-c7cc-4c3e-bc33-5530b4834484','What steps are involved in a complete function analysis?','אילו שלבים כרוכים בניתוח מלא של פונקציה?');
INSERT INTO Translation VALUES('ac4c99b9-3406-4bd5-bb0c-ab8ba5df8106','Domain, critical points, monotonicity, extrema, concavity, asymptotes','תחום, נקודות קריטיות, מונוטוניות, קיצון, קמירות, אסימפטוטות');
INSERT INTO Translation VALUES('677b36d8-a1d6-45d8-b42f-2c7f24761c72','Only finding the derivative','רק מציאת הנגזרת');
INSERT INTO Translation VALUES('d891528a-bde9-42f2-a697-68af6bbda3e5','Define what constitutes an extrema point of a function.','הגדר מה מהווה נקודת קיצון של פונקציה.');
INSERT INTO Translation VALUES('95815c7a-f5ca-46a4-8891-4a971e843873','A critical point occurs when:','נקודה קריטית מתרחשת כאשר:');
INSERT INTO Translation VALUES('62cea819-d461-4cc9-b517-f87dab6d2eaa','The derivative equals zero or does not exist','הנגזרת שווה לאפס או לא קיימת');
INSERT INTO Translation VALUES('b92702d9-4da4-4e9f-80ec-bc75a335f155','The function equals zero','הפונקציה שווה לאפס');
INSERT INTO Translation VALUES('b94a2174-5c7b-4ef3-bd8c-02e6fcd86d12','How do you find the absolute extrema of a continuous function on a closed interval?','איך מוצאים את הקיצון האבסולוטי של פונקציה רציפה על קטע סגור?');
INSERT INTO Translation VALUES('c35d2388-d3cf-4b90-885f-7ef61326b368','Check critical points inside the interval and endpoints','בדוק נקודות קריטיות בתוך הקטע ונקודות הקצה');
INSERT INTO Translation VALUES('68defb15-233b-4c33-8bc5-e0a2eef72fef','Only check the endpoints','רק בדוק את נקודות הקצה');
INSERT INTO Translation VALUES('dcab5814-415b-4c1f-bb53-31978a2ba204','State LHopitals rule and when it can be applied.','נסח את כלל לופיטל ומתי ניתן ליישמו.');
INSERT INTO Translation VALUES('bec8c5ad-888b-4093-8cdb-df04c941b244','What is the general approach to integrate rational functions?','מה הגישה הכללית לאינטגרציה של פונקציות רציונליות?');
INSERT INTO Translation VALUES('a714c49a-0839-4a55-87e9-89a7580285f4','Use partial fraction decomposition','השתמש בפירוק לשברים חלקיים');
INSERT INTO Translation VALUES('f60525d3-6818-410e-895f-49f2852ddf02','Always use substitution','תמיד השתמש בהחלפת משתנה');
INSERT INTO Translation VALUES('ebe885d0-b387-492c-9dae-f9d8d9c34b9d','Describe the continuation methods for integrating rational functions.','תאר את שיטות ההמשך לאינטגרציה של פונקציות רציונליות.');
INSERT INTO Translation VALUES('8deccec6-f67d-4ee8-aee9-ba21f0198c67','What characterizes integrable functions according to Riemann?','מה מאפיין פונקציות ניתנות לאינטגרציה על פי רימן?');
INSERT INTO Translation VALUES('b5d3fd1d-b6ab-46b5-b27a-ba4442ec7485','The set of discontinuities has measure zero','קבוצת נקודות אי-הרציפות בעלת מידה אפס');
INSERT INTO Translation VALUES('dc3c2a41-5b94-4e9c-ba35-4806367a640f','The function must be continuous everywhere','הפונקציה חייבת להיות רציפה בכל מקום');
INSERT INTO Translation VALUES('2e362bae-3a8b-4762-903d-c5e40af6b1e2','What is the relationship between definite integrals and inequalities?','מה הקשר בין אינטגרלים מסויימים ואי-שוויונות?');
INSERT INTO Translation VALUES('4e5c94e4-3557-4a2c-8678-dfb2b32e73d1','If f(x) <= g(x) on [a,b], then integral of f <= integral of g','אם f(x) <= g(x) על [a,b], אז אינטגרל f <= אינטגרל g');
INSERT INTO Translation VALUES('b45d2916-1bb3-4e21-bc09-53d78d1b8e5e','Inequalities dont affect integration','אי-שוויונות לא משפיעים על אינטגרציה');
INSERT INTO Translation VALUES('d6635e3c-5985-456a-9afd-886ad825a674','State the mean value theorem for integrals.','נסח את משפט הערך הממוצע לאינטגרלים.');
INSERT INTO Translation VALUES('6b144dc5-1c3f-4c24-9a34-52e98459df68','What is the substitution method for calculating integrals?','מהי שיטת ההחלפה לחישוב אינטגרלים?');
INSERT INTO Translation VALUES('e3edcf6c-48f4-418b-8048-4bad3a5276ab','Replace a complex expression with a single variable to simplify integration','החלף ביטוי מורכב במשתנה יחיד כדי לפשט את האינטגרציה');
INSERT INTO Translation VALUES('8180e784-be5b-429c-ab95-b08680885e64','Substitute the limits of integration only','החלף רק את גבולות האינטגרציה');
INSERT INTO Translation VALUES('b35b1798-3b57-4374-ae9d-56f23efa91b4','What does the second fundamental theorem of calculus state?','מה קובע המשפט היסודי השני של החשבון?');
INSERT INTO Translation VALUES('32680fd0-5dfe-4765-888a-2b9b68e4f798','If F is an antiderivative of f, then integral from a to b of f(x)dx = F(b) - F(a)','אם F היא פונקציה קדומה של f, אז אינטגרל מ-a עד b של f(x)dx = F(b) - F(a)');
INSERT INTO Translation VALUES('2157b1cf-6c50-480e-a5d5-a8a85cfa374d','Every continuous function has an antiderivative','לכל פונקציה רציפה יש פונקציה קדומה');
INSERT INTO Translation VALUES('ca18d1c5-84c9-4ffe-a01c-d8e3d6f3cdc3','When dealing with improper integrals of unbounded functions, what must be checked?','כשמתמודדים עם אינטגרלים לא אמיתיים של פונקציות לא חסומות, מה צריך לבדוק?');
INSERT INTO Translation VALUES('98e1ddca-f17c-4660-ae16-7692e73f84d5','The convergence of the limit as we approach the point of discontinuity','ההתכנסות של הגבול כשמתקרבים לנקודת אי-הרציפות');
INSERT INTO Translation VALUES('ec02b7e0-ff40-4419-bdb8-019c2a601192','Only the bounds of integration','רק גבולות האינטגרציה');
INSERT INTO Translation VALUES('4a141db0-8af4-46e3-9724-38af4dc59d14','Name two convergence tests for improper integrals.','תן שני מבחני התכנסות לאינטגרלים לא אמיתיים.');
INSERT INTO Translation VALUES('b06d4e37-e5e6-4f79-9aed-e8e26eb8aa17','What are equivalent definitions for the limit of a sequence?','מהן הגדרות שקולות לגבול של סדרה?');
INSERT INTO Translation VALUES('e4cd0ee0-fabe-4d08-bef6-44aea6da5e47','Epsilon-N definition and distance-based definition','הגדרת אפסילון-N והגדרה מבוססת מרחק');
INSERT INTO Translation VALUES('1f410f24-a31b-43ea-83b6-92d8799248f1','Only algebraic manipulation','רק מניפולציה אלגברית');
INSERT INTO Translation VALUES('7b38c315-c36c-4d76-a59d-dc52c7aa5f1e','How do you prove the existence or non-existence of limits?','איך מוכיחים קיום או אי-קיום של גבולות?');
INSERT INTO Translation VALUES('df584e5e-28bb-4c4e-87bd-8a8d6135eb3b','What are the basic limit theorems for sequences?','מהם משפטי הגבול הבסיסיים לסדרות?');
INSERT INTO Translation VALUES('aaf976e5-c5bc-43bf-ad1f-9c0fbe3a3152','Limit of sum equals sum of limits, limit of product equals product of limits','גבול של סכום שווה לסכום הגבולות, גבול של מכפלה שווה למכפלת הגבולות');
INSERT INTO Translation VALUES('65e2e182-c25b-4e5a-a3f7-0591c1817d56','All sequences have limits','לכל הסדרות יש גבולות');
INSERT INTO Translation VALUES('5b288ead-5fe6-4768-8e58-e34ddf6f1fef','Distinguish between convergence and divergence to infinity.','הבחן בין התכנסות להתכנסות לאינסוף.');
INSERT INTO Translation VALUES('62ac2cd6-2f7f-407b-b5b7-ad49c967107a','Define what it means for a sequence to be bounded.','הגדר מה פירוש שסדרה חסומה.');
INSERT INTO Translation VALUES('fafed926-e721-42ca-897b-a2408f1af636','What is the Squeeze theorem for sequences?','מה משפט הלחיצה לסדרות?');
INSERT INTO Translation VALUES('d25574d5-a5c4-4893-a1d6-cf9d9d3a7f6e','If an <= cn <= bn and lim(an) = lim(bn) = L, then lim(cn) = L','אם an <= cn <= bn ו lim(an) = lim(bn) = L, אז lim(cn) = L');
INSERT INTO Translation VALUES('a031edaf-d7ac-4a83-85fe-b11d1ecec655','Every bounded sequence converges','כל סדרה חסומה מתכנסת');
INSERT INTO Translation VALUES('d3c6230c-6ef8-478c-ba60-b762557ec5d7','What is special about monotone sequences?','מה מיוחד בסדרות מונוטוניות?');
INSERT INTO Translation VALUES('2f014a26-5ddf-472c-b5aa-f32117cf8afb','A bounded monotone sequence always converges','סדרה מונוטונית חסומה תמיד מתכנסת');
INSERT INTO Translation VALUES('71d6e466-cf7c-42ee-bc14-63d222def474','All monotone sequences are bounded','כל הסדרות המונוטוניות חסומות');
INSERT INTO Translation VALUES('d9b55b34-8c1e-4987-92fc-42a4bf5c59fc','Define what a subsequence is.','הגדר מהי תת-סדרה.');
INSERT INTO Translation VALUES('fb9deece-8ba7-4f0d-a0c9-1fe17dd0f854','What is the integral test for series convergence?','מה מבחן האינטגרל להתכנסות טורים?');
INSERT INTO Translation VALUES('12851a93-458d-40cd-b3c6-939d497bef3c','If f is positive, decreasing, and continuous, then the series and integral have the same convergence behavior','אם f חיובית, יורדת ורציפה, אז לטור ולאינטגרל אותה התנהגות התכנסות');
INSERT INTO Translation VALUES('598d5eff-fcbe-4c2d-83ad-07294741895d','Every series can be tested with an integral','כל טור ניתן לבחינה עם אינטגרל');
INSERT INTO Translation VALUES('55267611-7030-45e3-a75a-c658ecf5924b','Describe the comparison test for series.','תאר את מבחן ההשוואה לטורים.');
INSERT INTO Translation VALUES('6ec59c53-facc-45cd-b54f-2c951bd5c129','What is the limit comparison test?','מה מבחן השוואת הגבולות?');
INSERT INTO Translation VALUES('7a1d7a65-960e-486b-a7d9-04a054b948ca','Compare the limit of ratios of terms from two series','השווה את הגבול של יחסי האיברים משני טורים');
INSERT INTO Translation VALUES('726f07f6-bc85-4b60-913d-bbdede150476','Compare only the first terms of series','השווה רק את האיברים הראשונים של טורים');
INSERT INTO Translation VALUES('9869cea6-76ca-449c-8354-85c17c46a8de','What characterizes alternating series?','מה מאפיין טורים מתחלפים?');
INSERT INTO Translation VALUES('c263ac58-ec84-4c06-bb59-e27135661cf4','Terms alternate in sign and decrease in absolute value','האיברים מתחלפים בסימן ויורדים בערך מוחלט');
INSERT INTO Translation VALUES('17dcb0c2-74b1-47c0-b0ef-ac70f7ef8475','All terms are negative','כל האיברים שליליים');
INSERT INTO Translation VALUES('f1fda193-66c1-4d37-9918-d545e9ac1062','Define absolute convergence for series.','הגדר התכנסות אבסולוטית לטורים.');
INSERT INTO Translation VALUES('b0eb7555-5913-4019-8f56-c4ff5774e4b9','What is the ratio test for series convergence?','מה מבחן היחס להתכנסות טורים?');
INSERT INTO Translation VALUES('fa363f3b-da9c-48a2-9fa2-25485d2069b5','Take the limit of |a(n+1)/an| as n approaches infinity','קח את הגבול של |a(n+1)/an| כש-n שואף לאינסוף');
INSERT INTO Translation VALUES('2adb8aeb-4e3c-4569-8558-8e4d4db7b220','Compare consecutive terms directly','השווה איברים עוקבים ישירות');
INSERT INTO Translation VALUES('013e9aaa-ee5f-4038-a4cf-ce35f1b946ef','What is the root test for series convergence?','מה מבחן השורש להתכנסות טורים?');
INSERT INTO Translation VALUES('f4a71546-89b0-4d9a-9c82-14149f9c1fa0','Take the limit of (|an|)^(1/n) as n approaches infinity','קח את הגבול של (|an|)^(1/n) כש-n שואף לאינסוף');
INSERT INTO Translation VALUES('92259212-7419-4471-8444-711c528e1210','Take the square root of each term','קח שורש ריבועי של כל איבר');
INSERT INTO Translation VALUES('bef5f1df-288b-40f7-87a7-71373c0c554e','What defines a power series?','מה מגדיר טור חזקות?');
INSERT INTO Translation VALUES('b84bdc8e-9205-492b-b31c-4bdf3749c7a7','A series of the form sum of an*(x-c)^n','טור מהצורה סכום של an*(x-c)^n');
INSERT INTO Translation VALUES('14e790f6-d278-457c-bc9e-3b959e32d745','Any series with variable terms','כל טור עם איברים משתנים');
INSERT INTO Translation VALUES('254baab7-fe75-4bc0-854b-d23344168c99','How can functions be represented as power series?','איך ניתן לייצג פונקציות כטורי חזקות?');
INSERT INTO Translation VALUES('947687de-16e9-4329-9242-7af8f125efdd','What are one-sided derivatives?','מהן נגזרות חד-צדדיות?');
INSERT INTO Translation VALUES('90b07259-ac21-46e2-8381-7599d5af9302','Derivatives from the left or right side of a point','נגזרות מהצד השמאלי או הימני של נקודה');
INSERT INTO Translation VALUES('9489303d-bf19-4e8f-abf3-c882b3189251','Derivatives that are always positive or negative','נגזרות שהן תמיד חיוביות או שליליות');
INSERT INTO Translation VALUES('f7ba6817-cffb-43c3-9af9-ec565a543bdd','What are the derivatives of exponential and logarithmic functions?','מהן הנגזרות של פונקציות אקספוננציאליות ולוגריתמיות?');
INSERT INTO Translation VALUES('3ddffac8-f08d-438d-a89d-6667b8f6f595','d/dx(e^x) = e^x, d/dx(ln(x)) = 1/x','d/dx(e^x) = e^x, d/dx(ln(x)) = 1/x');
INSERT INTO Translation VALUES('fa440066-0fc0-411b-8409-98b3038c91f4','d/dx(e^x) = x*e^(x-1), d/dx(ln(x)) = x','d/dx(e^x) = x*e^(x-1), d/dx(ln(x)) = x');
INSERT INTO Translation VALUES('1283843d-6131-4615-8da8-be8533c4c22e','State Rolles theorem for derivatives.','נסח את משפט רול לנגזרות.');
INSERT INTO Translation VALUES('103cf2dc-a0e7-4af4-ae62-644847574547','What is the continuation of monotonicity in calculus?','מה המשך המונוטוניות בחשבון?');
INSERT INTO Translation VALUES('b0a0af66-3cfc-404c-bfaf-47587d8c1125','Using higher derivatives to determine behavior','שימוש בנגזרות גבוהות יותר לקביעת ההתנהגות');
INSERT INTO Translation VALUES('66b3d8ef-fa60-4db5-a636-a2bfeea05c8d','Monotonicity cannot be continued','לא ניתן להמשיך מונוטוניות');
INSERT INTO Translation VALUES('b690f684-e7c5-450d-9098-719aaf66bd2a','Describe the complete process of function analysis.','תאר את התהליך המלא של ניתוח פונקציה.');
INSERT INTO Translation VALUES('29a0e18a-7b09-4aea-945d-b0daae14ff20','What is the condition for a unique local extremum in an open interval?','מה התנאי לקיצון מקומי יחיד בקטע פתוח?');
INSERT INTO Translation VALUES('dcaead2b-4e32-44df-a793-5d785cbb7772','The function is continuous and has only one critical point','הפונקציה רציפה ויש לה רק נקודה קריטית אחת');
INSERT INTO Translation VALUES('8cf619bb-bffc-4839-b19f-10fe9f8acb9d','The function must be linear','הפונקציה חייבת להיות ליניארית');
INSERT INTO Translation VALUES('c8eb14a2-39a8-4163-8c8f-d88b2c5a8ca0','What are the basic techniques for integrating rational functions?','מהן הטכניקות הבסיסיות לאינטגרציה של פונקציות רציונליות?');
