INSERT INTO Translation VALUES('981a5b3f-d83d-4942-a632-2c11823b6fe0','How satisfied we are with a proof','כמה מרוצים אנחנו מהוכחה');
INSERT INTO Translation VALUES('3ed79ecc-f092-469d-9a66-b44be6270780','The complexity of a formula','המורכבות של נוסחה');
INSERT INTO Translation VALUES('1c58dffb-2e15-4e98-9f40-5369855fd5de','The length of a logical argument','האורך של טיעון לוגי');
INSERT INTO Translation VALUES('82627ebd-1524-45ca-9a11-a385448a63eb','The Hilbert system is a formal system for mathematical logic. True or false?','מערכת הילברט היא מערכת פורמלית ללוגיקה מתמטית. נכון או לא נכון?');
INSERT INTO Translation VALUES('64f1df92-17fc-4d31-a01e-e287942f267a','Proof theory studies formal proofs and their properties. True or false?','תורת ההוכחה חוקרת הוכחות פורמליות ואת התכונות שלהן. נכון או לא נכון?');
INSERT INTO Translation VALUES('93232811-ffb4-4549-be63-1f39519fa917','What does an inequality between definite integrals tell us about the relationship between the functions being integrated?','מה אומרת אי-שוויון בין אינטגרלים מוגדרים על הקשר בין הפונקציות המשולבות?');
INSERT INTO Translation VALUES('1bafb41c-7f18-4a9e-b58d-76c79a5108fa','If f(x) ≤ g(x) on [a,b], then ∫[a to b] f(x)dx ≤ ∫[a to b] g(x)dx','אם f(x) ≤ g(x) על [a,b], אז ∫[a to b] f(x)dx ≤ ∫[a to b] g(x)dx');
INSERT INTO Translation VALUES('7ec84dbc-8a6d-4e7d-a4cd-e9744ea01f23','The inequality reverses for integrals','האי-שוויון הופך לאינטגרלים');
INSERT INTO Translation VALUES('ce3f61cf-9436-4b3a-831e-8b062ccb549a','Integrals cannot be compared','אינטגרלים לא ניתנים להשוואה');
INSERT INTO Translation VALUES('ee91eb76-4b42-4c0f-9161-a51cf67cbf04','The inequality only holds for positive functions','האי-שוויון תקף רק לפונקציות חיוביות');
INSERT INTO Translation VALUES('12b4c958-9193-4535-ab58-0d26c353053b','If 0 ≤ f(x) ≤ g(x) on [0,2] and ∫[0 to 2] g(x)dx = 8, what can we say about ∫[0 to 2] f(x)dx?','אם 0 ≤ f(x) ≤ g(x) על [0,2] ו-∫[0 to 2] g(x)dx = 8, מה אפשר לומר על ∫[0 to 2] f(x)dx?');
INSERT INTO Translation VALUES('5946cab2-5cef-408a-a0ec-11b6914ec104','0 ≤ ∫[0 to 2] f(x)dx ≤ 8','0 ≤ ∫[0 to 2] f(x)dx ≤ 8');
INSERT INTO Translation VALUES('deae65e2-ae60-42d9-914e-9388369574e9','∫[0 to 2] f(x)dx = 8','∫[0 to 2] f(x)dx = 8');
INSERT INTO Translation VALUES('2dfe146c-dab4-4de8-b85c-0a72f65dffa7','∫[0 to 2] f(x)dx > 8','∫[0 to 2] f(x)dx > 8');
INSERT INTO Translation VALUES('8faca91c-5020-455e-af32-c2ce896e28d3','Cannot determine without more information','לא ניתן לקבוע בלי מידע נוסף');
INSERT INTO Translation VALUES('64bc5c02-c59a-4df7-b389-b9578fcd4d5a','What is the completion of subsequences in the context of mathematical sequences?','מה זה השלמת תת-סדרות בהקשר של סדרות מתמטיות?');
INSERT INTO Translation VALUES('9b2ae6e9-3f3f-40cc-8afe-f9cad4166cff','A technique to extend partial subsequences to complete subsequences with desired properties','טכניקה להרחיב תת-סדרות חלקיות לתת-סדרות שלמות עם תכונות רצויות');
INSERT INTO Translation VALUES('175e3287-8b74-442d-8b8d-b9fa1979a590','Finding the limit of a subsequence','מציאת הגבול של תת-סדרה');
INSERT INTO Translation VALUES('e3147eb1-b0a9-4862-a381-fbfcce711384','Removing elements from a sequence','הסרת איברים מסדרה');
INSERT INTO Translation VALUES('13c55d2a-1807-443b-a670-b68ec6e32959','Adding new terms to a sequence','הוספת איברים חדשים לסדרה');
INSERT INTO Translation VALUES('b13fcfb4-5b6e-438f-b732-49d291644fbc','Every bounded sequence has a convergent subsequence.','לכל סדרה חסומה יש תת-סדרה מתכנסת.');
INSERT INTO Translation VALUES('0975e4c5-095d-4e0a-9d7a-1be76e22827a','What defines an improper integral of an unbounded function?','מה מגדיר אינטגרל לא-תקין של פונקציה לא-חסומה?');
INSERT INTO Translation VALUES('161c354a-664f-4e0d-8605-bbb92db5b78e','An integral where the function has vertical asymptotes in the integration interval','אינטגרל שבו לפונקציה יש אסימפטוטות אנכיות במרווח האינטגרציה');
INSERT INTO Translation VALUES('2a56724a-e97d-4a03-8de3-0f533de0a17a','An integral with infinite limits','אינטגרל עם גבולות אינסופיים');
INSERT INTO Translation VALUES('0b6ed589-2bf2-4559-bf4a-a14d72ac302f','An integral of a continuous function','אינטגרל של פונקציה רציפה');
INSERT INTO Translation VALUES('48273547-cdfa-485f-80bc-5ea093a5fc75','An integral that equals infinity','אינטגרל ששווה לאינסוף');
INSERT INTO Translation VALUES('2fb355b3-e76f-4243-90d5-d94e2379cb75','How do we evaluate ∫[0 to 1] 1/√x dx?','איך מחשבים את ∫[0 to 1] 1/√x dx?');
INSERT INTO Translation VALUES('9484268f-cb2d-4719-b7df-ecdee980ac03','lim(t→0+) ∫[t to 1] x^(-1/2) dx = lim(t→0+) [2√x] from t to 1 = 2','lim(t→0+) ∫[t to 1] x^(-1/2) dx = lim(t→0+) [2√x] מ-t ל-1 = 2');
INSERT INTO Translation VALUES('0c109cec-64dc-4376-b9eb-86ff6720a975','The integral diverges','האינטגרל מתבדר');
INSERT INTO Translation VALUES('5d871514-6396-42f8-8c49-37055a0a26ce','∫[0 to 1] 1/√x dx = 1','∫[0 to 1] 1/√x dx = 1');
INSERT INTO Translation VALUES('70c47f0c-fa17-4c65-bc27-5d8afb51108a','The integral is undefined','האינטגרל לא מוגדר');
INSERT INTO Translation VALUES('2880949b-0203-4aab-97ab-7e3c67a47a00','What is the comparison test for improper integrals?','מה זה מבחן ההשוואה לאינטגרלים לא-תקינים?');
INSERT INTO Translation VALUES('c0946812-e3cf-43d7-a5e7-95578803bd7a','If 0 ≤ f(x) ≤ g(x) and ∫g(x)dx converges, then ∫f(x)dx converges','אם 0 ≤ f(x) ≤ g(x) ו-∫g(x)dx מתכנס, אז ∫f(x)dx מתכנס');
INSERT INTO Translation VALUES('800b3e0b-1cc6-4dc1-9b65-69dd86d88754','Compare derivatives of functions','השוואת נגזרות של פונקציות');
INSERT INTO Translation VALUES('c6245b2b-13c5-4d14-9e83-1ee5b9b69300','Compare limits of functions','השוואת גבולות של פונקציות');
INSERT INTO Translation VALUES('6c6ff970-0e1d-4826-b396-fd3595dc79b1','Compare antiderivatives','השוואת פונקציות קדומות');
INSERT INTO Translation VALUES('95bf16c8-9897-4fdc-9a5a-99c748e06d3d','What is Rolle''s theorem?','מה זה משפט רול?');
INSERT INTO Translation VALUES('1dba5591-e739-466f-bed3-e8fba923be7e','If f is continuous on [a,b], differentiable on (a,b), and f(a)=f(b), then there exists c in (a,b) such that f''(c)=0','אם f רציפה על [a,b], גזירה על (a,b), ו-f(a)=f(b), אז קיים c ב-(a,b) כך ש-f''(c)=0');
INSERT INTO Translation VALUES('13e1af38-3c9b-4769-aaf9-a7176f741415','The derivative of a function equals zero at its maximum','הנגזרת של פונקציה שווה לאפס במקסימום שלה');
INSERT INTO Translation VALUES('e05aa0e9-c5c1-457f-9bb2-9ede3410cb7f','Every continuous function is differentiable','כל פונקציה רציפה גזירה');
INSERT INTO Translation VALUES('08de8bf8-1308-49f8-b3f3-9ffbbb4ab71d','The integral of a derivative is the original function','האינטגרל של נגזרת הוא הפונקציה המקורית');
INSERT INTO Translation VALUES('d29fab16-0bd6-4b41-a2b3-4e0c49b604b6','What is the mean value theorem of differential calculus?','מה זה משפט ערך הממוצע של חשבון דיפרנציאלי?');
INSERT INTO Translation VALUES('530ba3d0-cd07-4260-bd89-814150f52497','If f is continuous on [a,b] and differentiable on (a,b), then there exists c in (a,b) such that f''(c) = (f(b)-f(a))/(b-a)','אם f רציפה על [a,b] וגזירה על (a,b), אז קיים c ב-(a,b) כך ש-f''(c) = (f(b)-f(a))/(b-a)');
INSERT INTO Translation VALUES('bbb31c79-3de4-4d1d-a369-f59ddf89725f','The average value of a function equals its integral','הערך הממוצע של פונקציה שווה לאינטגרל שלה');
INSERT INTO Translation VALUES('04cc890a-884a-4fcf-a80d-1547fe3a7736','Every function has a mean value','לכל פונקציה יש ערך ממוצע');
INSERT INTO Translation VALUES('59d2994c-e73b-4d01-8e5b-97cd6c147427','The derivative is always continuous','הנגזרת תמיד רציפה');
INSERT INTO Translation VALUES('e72a5b4c-2b57-4e0f-9fbf-96ecd9318fd0','A function is monotone increasing if f(x₁) ≤ f(x₂) whenever x₁ ≤ x₂.','פונקציה היא מונוטונית עולה אם f(x₁) ≤ f(x₂) כאשר x₁ ≤ x₂.');
INSERT INTO Translation VALUES('91300db9-2932-4d3d-aa64-65419c788941','What does the first derivative test tell us?','מה אומר לנו מבחן הנגזרת הראשונה?');
INSERT INTO Translation VALUES('f9a0aa00-b91a-4f6b-bb7e-a56b3b95904d','If f''(x) changes from positive to negative at c, then f has a local maximum at c','אם f''(x) משנה מחיובי לשלילי ב-c, אז ל-f יש מקסימום מקומי ב-c');
INSERT INTO Translation VALUES('6b00a652-af83-4762-bf10-499625b18f01','The first derivative always exists','הנגזרת הראשונה תמיד קיימת');
INSERT INTO Translation VALUES('0f2fe2fb-3396-46cd-aac2-b02629becbc8','Critical points are always extrema','נקודות קריטיות הן תמיד קיצוניות');
INSERT INTO Translation VALUES('dd9cf01c-39f1-4a1c-b262-29590d92ec44','The function is always increasing','הפונקציה תמיד עולה');
INSERT INTO Translation VALUES('68cf1b56-a5ac-47af-b312-c28407f5653c','How do we find local extrema points of a function?','איך מוצאים נקודות קיצון מקומיות של פונקציה?');
INSERT INTO Translation VALUES('cc5db81d-2d2c-439a-b1d4-99ff70488251','Find critical points where f''(x) = 0 or f''(x) is undefined, then use first or second derivative test','מוצאים נקודות קריטיות שבהן f''(x) = 0 או f''(x) לא מוגדרת, ואז משתמשים במבחן נגזרת ראשונה או שנייה');
INSERT INTO Translation VALUES('111f459e-a60f-49f6-9e4f-1f0722b7553f','Look for points where the function equals zero','מחפשים נקודות שבהן הפונקציה שווה לאפס');
INSERT INTO Translation VALUES('e994ca40-1d36-47fd-9117-5d13689a8e50','Find where the function is continuous','מוצאים היכן הפונקציה רציפה');
INSERT INTO Translation VALUES('2946549c-8baa-4c6f-b0b9-80a18ccdc3e8','Calculate the integral of the function','מחשבים את האינטגרל של הפונקציה');
INSERT INTO Translation VALUES('2cfe3138-8a8d-47a0-9e67-d87ec7323afe','What characterizes convexity and concavity of a function?','מה מאפיין קמירות וקערות של פונקציה?');
INSERT INTO Translation VALUES('a964653d-4c6e-4c79-a300-eac5138fc6df','A function is convex if f''(x) ≥ 0 and concave if f''(x) ≤ 0','פונקציה קמורה אם f''(x) ≥ 0 וקעורה אם f''(x) ≤ 0');
INSERT INTO Translation VALUES('c06e5afa-9433-4b48-b972-bd50a788b514','Convexity depends only on the first derivative','קמירות תלויה רק בנגזרת הראשונה');
INSERT INTO Translation VALUES('8725353a-068c-4b72-8de3-b83f250c12f4','All functions are either convex or concave','כל הפונקציות קמורות או קעורות');
