INSERT INTO Translation VALUES('fd510d63-2014-4907-a2f1-895a210e385a','Only find the derivative and set it to zero','רק מוצאים את הנגזרת ומשווים לאפס');
INSERT INTO Translation VALUES('9b8583db-7ae0-4489-8611-8cbab3d93f3f','Calculate the integral of the function','מחשבים את האינטגרל של הפונקציה');
INSERT INTO Translation VALUES('e34fbc85-5144-46c7-bbe6-aff7902eb121','Find only the maximum and minimum values','מוצאים רק את הערכים המקסימליים והמינימליים');
INSERT INTO Translation VALUES('1d93be6d-7e5d-4cc0-9f56-09e27e2c8133','What defines extrema points of a function?','מה מגדיר נקודות קיצון של פונקציה?');
