INSERT INTO Translation VALUES('c19206ee-fe7a-4d24-a6be-76023a514e74','Points where the function is undefined','נקודות שבהן הפונקציה לא מוגדרת');
INSERT INTO Translation VALUES('4399e666-0646-43d9-bf8c-46af86a559d7','Points where the function equals zero','נקודות שבהן הפונקציה שווה לאפס');
INSERT INTO Translation VALUES('c5425e7c-ce82-46c3-bbd7-f591803d41eb','Points where the function is continuous','נקודות שבהן הפונקציה רציפה');
INSERT INTO Translation VALUES('b94fc5cb-59a0-4870-9533-615eb3671b1e','What are critical points of a function?','מה הן נקודות קריטיות של פונקציה?');
