INSERT INTO Translation VALUES('804affcb-6b78-4095-ad63-7cd4f40fdadf','Points where f(x) = 0','נקודות שבהן f(x) = 0');
INSERT INTO Translation VALUES('2f411d62-3387-4d1a-8c20-9784497700c1','Points where the function is discontinuous','נקודות שבהן הפונקציה לא רציפה');
INSERT INTO Translation VALUES('62a9bd17-219c-46c6-a001-0cf080bf91a9','Points at the boundary of the domain','נקודות בגבול של התחום');
INSERT INTO Translation VALUES('06e5d46d-abd6-4fdd-9823-3802097d6afc','How do we find absolute extrema of a continuous function on a closed interval?','איך מוצאים קיצון מוחלט של פונקציה רציפה על מרווח סגור?');
