INSERT INTO Translation VALUES('1fc140c2-ed8d-4534-a12c-6b6bc7a03060','Finding integrals','מציאת אינטגרלים');
INSERT INTO Translation VALUES('5e6504fc-f745-4293-b234-7686601c20e3','What characterizes a unique local extremum point of a continuous function on an open interval?','מה מאפיין נקודת קיצון מקומית יחידה של פונקציה רציפה על מרווח פתוח?');
INSERT INTO Translation VALUES('a8b4601e-42ea-4eff-a37e-a77e90424c75','If a continuous function has exactly one critical point in an open interval, it must be a global extremum','אם לפונקציה רציפה יש בדיוק נקודה קריטית אחת במרווח פתוח, היא חייבת להיות קיצון גלובלי');
INSERT INTO Translation VALUES('db16f8ff-d500-4906-8ce1-55b853628e5c','The function must be differentiable everywhere','הפונקציה חייבת להיות גזירה בכל מקום');
INSERT INTO Translation VALUES('804ac6d0-eb76-4e80-8d38-363d95be8a97','The extremum must be at the boundary','הקיצון חייב להיות בגבול');
INSERT INTO Translation VALUES('3c9ae9ef-fe82-4a28-8ccc-b5a22bf11ccc','The function must be monotonic','הפונקציה חייבת להיות מונוטונית');
INSERT INTO Translation VALUES('fdf6776d-c0bb-4da8-b07c-ac08980b9535','How do we integrate rational functions?','איך מבצעים אינטגרציה של פונקציות רציונליות?');
INSERT INTO Translation VALUES('bc2bccb5-fa72-4054-869e-1cb2070bf3c3','Use partial fraction decomposition to break into simpler fractions','משתמשים בפירוק לשברים חלקיים כדי לפרק לשברים פשוטים יותר');
INSERT INTO Translation VALUES('f8116236-bc3c-43b8-a91e-3d1b44b98f49','Always use substitution','תמיד משתמשים בהחלפה');
INSERT INTO Translation VALUES('9af651c9-ac2c-48d9-a881-89487bd5e4ba','Use integration by parts','משתמשים באינטגרציה בחלקים');
INSERT INTO Translation VALUES('b2dd4858-7b25-4f0e-b8f2-faa39cb351d5','Direct antiderivative','פונקציה קדומה ישירה');
INSERT INTO Translation VALUES('2b6e3e9b-e0fb-4b46-a918-aaca6e23c92b','What is the completion process for integrals of rational functions?','מה תהליך ההשלמה לאינטגרלים של פונקציות רציונליות?');
INSERT INTO Translation VALUES('4de8f4bf-b848-4740-9adc-35e115e03e7c','After partial fraction decomposition, integrate each term and combine results','אחרי פירוק לשברים חלקיים, מבצעים אינטגרציה לכל איבר ומשלבים את התוצאות');
INSERT INTO Translation VALUES('de061437-cb7e-4034-bc55-6e058f077cb8','Use only polynomial long division','משתמשים רק בחילוק ארוך של פולינומים');
INSERT INTO Translation VALUES('6ab2705b-2336-4185-a00e-ea69a3ef2f79','Apply L''Hôpital''s rule','מיישמים את כלל לופיטל');
INSERT INTO Translation VALUES('40755f88-2cde-4949-8aaa-2e446f9ec9fe','Use trigonometric substitution only','משתמשים רק בהחלפה טריגונומטרית');
INSERT INTO Translation VALUES('b153fbad-50ce-4198-b271-2ddd88b21054','What characterizes integrable functions?','מה מאפיין פונקציות הניתנות לאינטגרציה?');
INSERT INTO Translation VALUES('a1db8342-4593-4bdf-aae1-c614d7c19cdb','Functions that are continuous almost everywhere or have a finite number of discontinuities','פונקציות שרציפות כמעט בכל מקום או שיש להן מספר סופי של אי-רציפויות');
INSERT INTO Translation VALUES('23d4fad6-38f9-498a-9550-7583a137b11b','Only continuous functions','רק פונקציות רציפות');
INSERT INTO Translation VALUES('0bd79528-995c-4582-ac44-a92e7f87248a','Only differentiable functions','רק פונקציות גזירות');
INSERT INTO Translation VALUES('a0a3f1b5-82a1-42e9-a83b-6eb5069e10d7','Only polynomial functions','רק פונקציות פולינומיות');
INSERT INTO Translation VALUES('10cd6020-91b3-4423-a7cf-178d3e0ea054','What is the mean value theorem for integrals?','מה זה משפט ערך הממוצע לאינטגרלים?');
INSERT INTO Translation VALUES('bb8881d2-5ce8-4e50-a269-8e4e0c4753bf','If f is continuous on [a,b], then there exists c in [a,b] such that ∫[a to b] f(x)dx = f(c)(b-a)','אם f רציפה על [a,b], אז קיים c ב-[a,b] כך ש-∫[a to b] f(x)dx = f(c)(b-a)');
INSERT INTO Translation VALUES('3cfd5c24-8e52-431f-ae38-ab625d35c740','The integral equals the average of the endpoints','האינטגרל שווה לממוצע של נקודות הקצה');
INSERT INTO Translation VALUES('f2d68561-ee87-4d64-9e6a-9680e8b8148f','Every function has a mean value','לכל פונקציה יש ערך ממוצע');
INSERT INTO Translation VALUES('3f407671-2cac-4cbb-ae11-b84f3fad1efe','The derivative at some point equals the slope','הנגזרת בנקודה כלשהי שווה לשיפוע');
INSERT INTO Translation VALUES('9dda09a2-7441-4284-9c5d-321369a61de6','What defines a finite sequence?','מה מגדיר סדרה סופית?');
INSERT INTO Translation VALUES('8508fa8f-de5e-4f95-a55e-a9654537fa51','A sequence with a finite number of terms, typically denoted as a₁, a₂, ..., aₙ','סדרה עם מספר סופי של איברים, בדרך כלל מסומנת כ-a₁, a₂, ..., aₙ');
INSERT INTO Translation VALUES('3a1e6aa6-ccb4-448a-9fee-c8b957681917','A sequence that converges to a finite limit','סדרה שמתכנסת לגבול סופי');
INSERT INTO Translation VALUES('f05e9ebf-9fe1-4396-b478-152a91f8281a','A sequence of integers only','סדרה של מספרים שלמים בלבד');
INSERT INTO Translation VALUES('14081458-0448-40b9-accd-e51af4eba96c','A sequence that is bounded','סדרה שהיא חסומה');
INSERT INTO Translation VALUES('3374089c-e78e-4b12-bedd-a1b824e422ca','What are equivalent definitions of the limit of a sequence?','מהן הגדרות שקולות לגבול של סדרה?');
INSERT INTO Translation VALUES('dad17c2c-6ef8-4770-b899-e0c773a107e6','ε-δ definition and neighborhood definition both characterize convergence','הגדרת ε-δ והגדרת שכונות שתיהן מאפיינות התכנסות');
INSERT INTO Translation VALUES('dc625e12-7d37-4f16-b7f2-3c505b3f44b3','Only the ε-δ definition is valid','רק הגדרת ε-δ תקפה');
INSERT INTO Translation VALUES('0c0b6d58-c356-4a46-9c2e-4426aaa6f1c5','Limits are always unique','גבולות תמיד יחידים');
INSERT INTO Translation VALUES('374774d7-741e-4ea6-bcff-0f6c310b02a7','All sequences have limits','לכל הסדרות יש גבולות');
INSERT INTO Translation VALUES('3635c6e8-f7f1-44ea-a193-b1540ea05808','How do we prove existence or non-existence of limits?','איך מוכיחים קיום או אי-קיום של גבולות?');
INSERT INTO Translation VALUES('757abfdf-0ef3-4cd9-bda0-14ba60992665','Use definition directly, squeeze theorem, or show the sequence is not Cauchy','משתמשים בהגדרה ישירות, במשפט הכריך, או מראים שהסדרה לא קושי');
INSERT INTO Translation VALUES('bae02d75-d97c-423f-b6ec-58058e71c96a','Only use the ε-δ definition','רק משתמשים בהגדרת ε-δ');
INSERT INTO Translation VALUES('5fbfffef-cef1-49b6-a03b-1b9bd31ee849','Check if the sequence is monotonic','בודקים אם הסדרה מונוטונית');
INSERT INTO Translation VALUES('e50bf96c-1438-4ea6-8693-aeab5e50e894','Calculate the derivative','מחשבים את הנגזרת');
INSERT INTO Translation VALUES('86dd69f9-6f82-41b0-953a-e8688bbf2262','What are the main limit theorems for sequences?','מהם משפטי הגבול העיקריים לסדרות?');
INSERT INTO Translation VALUES('05fef986-4c5f-4e1f-8c54-bd6ab50cf15d','If lim aₙ = L and lim bₙ = M, then lim(aₙ + bₙ) = L + M, lim(aₙ · bₙ) = L · M','אם lim aₙ = L ו-lim bₙ = M, אז lim(aₙ + bₙ) = L + M, lim(aₙ · bₙ) = L · M');
INSERT INTO Translation VALUES('7ecee0d1-1ca0-4a93-a136-022d5c0920c5','Limits are always additive only','גבולות תמיד אדיטיביים בלבד');
INSERT INTO Translation VALUES('5d4cac5c-811a-4fb4-ba08-4943fa525985','Only sum theorem applies','רק משפט הסכום חל');
INSERT INTO Translation VALUES('2dd2bff2-de4a-44f1-b752-0e87e6cb3c14','Limits cannot be combined','גבולות לא ניתנים לשילוב');
INSERT INTO Translation VALUES('7c67cacf-8cd0-4154-870b-304f91278998','What does convergence to infinity mean for sequences?','מה משמעות התכנסות לאינסוף עבור סדרות?');
INSERT INTO Translation VALUES('507f5494-5d83-4006-8d34-311ab07c2165','For any M > 0, there exists N such that for n > N, |aₙ| > M','לכל M > 0, קיים N כך שלכל n > N, |aₙ| > M');
INSERT INTO Translation VALUES('965450e1-8000-4397-859b-9587dd8f9c98','The sequence becomes very large','הסדרה הופכת גדולה מאוד');
INSERT INTO Translation VALUES('55451c74-b0fe-4100-ad10-adb7260e0f1c','The sequence has infinitely many terms','לסדרה יש אינסוף איברים');
INSERT INTO Translation VALUES('554b0b4f-c434-449c-9c7a-b7a7bac115e4','The sequence oscillates','הסדרה מתנדנדת');
INSERT INTO Translation VALUES('ac49c4a3-367c-4f90-bfcd-3c3f06c813ab','A bounded sequence is one where there exist real numbers m and M such that m ≤ aₙ ≤ M for all n.','סדרה חסומה היא כזאת שקיימים מספרים ממשיים m ו-M כך ש-m ≤ aₙ ≤ M לכל n.');
INSERT INTO Translation VALUES('f421b35f-5704-40f9-b114-d503b38c690d','What is the squeeze theorem for sequences?','מה זה משפט הכריך לסדרות?');
INSERT INTO Translation VALUES('8e57827e-0325-4ae1-8b72-5b9e3dc00c7e','If aₙ ≤ bₙ ≤ cₙ and lim aₙ = lim cₙ = L, then lim bₙ = L','אם aₙ ≤ bₙ ≤ cₙ ו-lim aₙ = lim cₙ = L, אז lim bₙ = L');
INSERT INTO Translation VALUES('0ffd4364-aac2-407b-be7e-8a5185cc7709','Bounded sequences always converge','סדרות חסומות תמיד מתכנסות');
INSERT INTO Translation VALUES('8b6ab634-fc85-473b-b589-a79f8bfab239','Monotonic sequences are squeezed','סדרות מונוטוניות נכרכות');
INSERT INTO Translation VALUES('338cfd42-17ed-489e-8519-e0ba678622d1','All sequences can be squeezed','כל הסדרות ניתנות לכריכה');
INSERT INTO Translation VALUES('ed6dc918-3a82-421b-a02e-5c5b35f17e44','What characterizes monotone sequences?','מה מאפיין סדרות מונוטוניות?');
INSERT INTO Translation VALUES('6b8834d9-3425-4f9f-b7f7-88a9978c2518','A sequence is monotone increasing if aₙ₊₁ ≥ aₙ for all n, and decreasing if aₙ₊₁ ≤ aₙ','סדרה מונוטונית עולה אם aₙ₊₁ ≥ aₙ לכל n, ויורדת אם aₙ₊₁ ≤ aₙ');
INSERT INTO Translation VALUES('7dda9706-4b0e-45f3-98d5-3849e06cc2ee','The sequence must be continuous','הסדרה חייבת להיות רציפה');
INSERT INTO Translation VALUES('153d8219-a364-484a-a8e6-2691852aa02e','The sequence must converge','הסדרה חייבת להתכנס');
INSERT INTO Translation VALUES('a70eab36-bff2-46c1-8603-5616592de3cd','The sequence must be bounded','הסדרה חייבת להיות חסומה');
INSERT INTO Translation VALUES('48efefcd-52c4-4203-9978-1cade4ac2b22','What is a subsequence?','מה זה תת-סדרה?');
INSERT INTO Translation VALUES('478ec895-8ac4-43e6-b2a0-b123fa911dce','A sequence obtained by taking elements from the original sequence in increasing index order','סדרה המתקבלת על ידי לקיחת איברים מהסדרה המקורית בסדר עולה של אינדקסים');
INSERT INTO Translation VALUES('07b3be93-a4fa-4400-b9cf-bcd0aabbe41e','A sequence with fewer terms','סדרה עם פחות איברים');
INSERT INTO Translation VALUES('ee655581-f721-4a6c-a762-459a8aa8fc24','A sequence that converges','סדרה שמתכנסת');
INSERT INTO Translation VALUES('d29b5928-36f5-4145-aed3-a35c8a976a85','A sequence of partial sums','סדרה של סכומים חלקיים');
INSERT INTO Translation VALUES('b94640ae-4878-48c0-8f71-5be7f869f543','What defines an infinite series?','מה מגדיר טור אינסופי?');
INSERT INTO Translation VALUES('c9bbd83f-1902-4735-b12b-14d8122390b5','The sum ∑(n=1 to ∞) aₙ, defined as the limit of partial sums Sₙ = ∑(k=1 to n) aₖ','הסכום ∑(n=1 to ∞) aₙ, המוגדר כגבול של סכומים חלקיים Sₙ = ∑(k=1 to n) aₖ');
INSERT INTO Translation VALUES('4ce6cf96-59c2-4e2c-b5ec-1bc11bf864c1','A very long finite sum','סכום סופי ארוך מאוד');
INSERT INTO Translation VALUES('2c7e118b-86f7-493d-a452-000e2718c855','A sequence of numbers','סדרה של מספרים');
INSERT INTO Translation VALUES('cb4605fd-4a28-41d3-b8f0-2f7983a8edba','The product of infinitely many terms','המכפלה של אינסוף איברים');
INSERT INTO Translation VALUES('259fc290-390a-4fa7-aa4d-540d687705de','What is the integral test for series convergence?','מה זה מבחן האינטגרל להתכנסות טורים?');
INSERT INTO Translation VALUES('711340c7-c6b1-497e-83a9-a194c714efc3','If f(x) is positive, decreasing, and continuous, then ∑aₙ and ∫f(x)dx have the same convergence behavior','אם f(x) חיובית, יורדת ורציפה, אז ל-∑aₙ ול-∫f(x)dx יש אותו התנהגות התכנסות');
INSERT INTO Translation VALUES('358b4fd8-8858-41e9-be0d-d6e4073e0216','All series can be tested with integrals','כל הטורים ניתנים לבדיקה עם אינטגרלים');
INSERT INTO Translation VALUES('00001fdc-0a64-4340-8d64-19b42f9100c4','The integral always converges','האינטגרל תמיד מתכנס');
INSERT INTO Translation VALUES('a300ba7e-940c-4262-96bc-43a208e36361','Only use for alternating series','משתמשים רק לטורים מתחלפים');
INSERT INTO Translation VALUES('06795e29-9ce6-4eda-90ce-b963cd5ceb79','What is the comparison test for series?','מה זה מבחן ההשוואה לטורים?');
INSERT INTO Translation VALUES('b2225b7b-e401-47d3-8f8d-2d066595c304','If 0 ≤ aₙ ≤ bₙ and ∑bₙ converges, then ∑aₙ converges; if ∑aₙ diverges, then ∑bₙ diverges','אם 0 ≤ aₙ ≤ bₙ ו-∑bₙ מתכנס, אז ∑aₙ מתכנס; אם ∑aₙ מתבדר, אז ∑bₙ מתבדר');
INSERT INTO Translation VALUES('eb2d9d1c-0f69-4fee-bfe1-6916be6a2e16','Compare only the first terms','משווים רק את האיברים הראשונים');
INSERT INTO Translation VALUES('227dd6a2-06fc-439e-bb5c-d93a6c583cf7','All terms must be equal','כל האיברים חייבים להיות שווים');
INSERT INTO Translation VALUES('54d5c512-1615-47fe-98f6-1196a189ce5d','Only works for positive series','עובד רק לטורים חיוביים');
INSERT INTO Translation VALUES('2c9c81a4-54ec-44e7-9170-de94b9807ff6','What is the limit comparison test?','מה זה מבחן השוואת הגבולות?');
INSERT INTO Translation VALUES('774a4b22-9b02-4cb2-819e-f482ccd39922','If lim(aₙ/bₙ) = L > 0 and finite, then ∑aₙ and ∑bₙ have the same convergence behavior','אם lim(aₙ/bₙ) = L > 0 וסופי, אז ל-∑aₙ ול-∑bₙ יש אותה התנהגות התכנסות');
INSERT INTO Translation VALUES('93d27d88-71d2-4c6f-a79b-fd2e32cb183d','Compare the limits of the series','משווים את הגבולות של הטורים');
INSERT INTO Translation VALUES('d958b91a-6664-461a-9c97-528cd958a4d2','The ratio must equal 1','היחס חייב להיות שווה ל-1');
INSERT INTO Translation VALUES('3a1c92de-df5b-4f25-a9c2-088ac6a6d407','Only use when direct comparison fails','משתמשים רק כאשר השוואה ישירה נכשלת');
INSERT INTO Translation VALUES('f4fe7ec4-f69a-4970-b1be-15cb7dfad664','What characterizes alternating series?','מה מאפיין טורים מתחלפים?');
INSERT INTO Translation VALUES('360710d6-f892-4fa8-a7ee-2da85301ba82','Series of the form ∑(-1)ⁿaₙ where aₙ > 0, with terms alternating in sign','טורים מהצורה ∑(-1)ⁿaₙ כאשר aₙ > 0, עם איברים מתחלפים בסימן');
INSERT INTO Translation VALUES('b867eb65-b48b-4c24-a445-05411c98e76e','Series that change direction','טורים שמשנים כיוון');
INSERT INTO Translation VALUES('37082824-e233-4175-8f37-667e157c9580','Series with even and odd terms','טורים עם איברים זוגיים ואי-זוגיים');
INSERT INTO Translation VALUES('cdc25e4f-42b9-4325-b9d1-11ef2e7c1077','Series that always converge','טורים שתמיד מתכנסים');
INSERT INTO Translation VALUES('7bd85a8f-16a4-49ed-b0aa-b6bc10265f3d','What is absolute convergence?','מה זו התכנסות מוחלטת?');
INSERT INTO Translation VALUES('91329646-a311-4285-b90c-10286a770b93','A series ∑aₙ converges absolutely if ∑|aₙ| converges','טור ∑aₙ מתכנס באופן מוחלט אם ∑|aₙ| מתכנס');
INSERT INTO Translation VALUES('24ec0989-2b10-46c4-bdfc-0a187fdff9e5','The series converges to an absolute value','הטור מתכנס לערך מוחלט');
INSERT INTO Translation VALUES('72ecc516-d6e5-4501-8c91-6a4e549bfbce','All terms are positive','כל האיברים חיוביים');
INSERT INTO Translation VALUES('cc926866-8b78-41f1-af8e-97993d0cb443','The limit is always positive','הגבול תמיד חיובי');
INSERT INTO Translation VALUES('f24489d0-b9b1-4ecd-83d2-7f4e9d49f667','What is the ratio test for series convergence?','מה זה מבחן היחס להתכנסות טורים?');
INSERT INTO Translation VALUES('20ebf01f-5827-482c-812e-b08628d50a61','If lim|aₙ₊₁/aₙ| = L < 1, the series converges; if L > 1, it diverges; if L = 1, the test is inconclusive','אם lim|aₙ₊₁/aₙ| = L < 1, הטור מתכנס; אם L > 1, הוא מתבדר; אם L = 1, המבחן לא חד-משמעי');
INSERT INTO Translation VALUES('f4b8acbf-a32d-40ee-914c-e2c78344cd50','Compare consecutive terms only','משווים רק איברים עוקבים');
INSERT INTO Translation VALUES('5f18a06e-cd2b-4c21-a02b-04f949d17b35','The ratio must be constant','היחס חייב להיות קבוע');
INSERT INTO Translation VALUES('e63b78b3-e1cd-41c9-82b4-597cd05c4dbe','Works only for geometric series','עובד רק לטורים גאומטריים');
INSERT INTO Translation VALUES('2187fa2f-feb9-44e0-9699-a01c34cda9a8','What is the root test for series?','מה זה מבחן השורש לטורים?');
INSERT INTO Translation VALUES('0bd2fd8f-f6be-49d4-8bd3-749393a3e38d','If lim(|aₙ|^(1/n)) = L < 1, the series converges; if L > 1, it diverges; if L = 1, inconclusive','אם lim(|aₙ|^(1/n)) = L < 1, הטור מתכנס; אם L > 1, הוא מתבדר; אם L = 1, לא חד-משמעי');
INSERT INTO Translation VALUES('3108401b-64fe-413b-b60e-01bf5ea5c947','Take the square root of each term','לוקחים שורש ריבועי לכל איבר');
INSERT INTO Translation VALUES('e0b9f310-d785-4235-a45e-a0eef617ae82','Works only for polynomial series','עובד רק לטורים פולינומיים');
INSERT INTO Translation VALUES('32637732-4426-4c60-8883-ef2f1a2085c8','Always gives a definitive answer','תמיד נותן תשובה חד-משמעית');
INSERT INTO Translation VALUES('4727f431-e23f-4b4b-ba96-034eee23ece0','What defines a power series?','מה מגדיר טור חזקות?');
INSERT INTO Translation VALUES('6fa8085c-0306-40fb-8222-727eb45b38bf','A series of the form ∑aₙ(x-c)ⁿ where aₙ are coefficients and c is the center','טור מהצורה ∑aₙ(x-c)ⁿ כאשר aₙ הם מקדמים ו-c הוא המרכז');
INSERT INTO Translation VALUES('99cbea78-beeb-475b-8b59-4278066ab593','A series with only positive powers','טור עם רק חזקות חיוביות');
INSERT INTO Translation VALUES('a7d66523-b379-4da6-b2a2-798a753eec7e','A polynomial of infinite degree','פולינום בדרגה אינסופית');
INSERT INTO Translation VALUES('16fc16e3-b4fd-41d2-8f0c-545ba2c20955','A series that always converges','טור שתמיד מתכנס');
INSERT INTO Translation VALUES('fcc39c4e-f0b6-41ed-a532-c5347f52b302','How can we represent functions as power series?','איך אפשר לייצג פונקציות כטורי חזקות?');
INSERT INTO Translation VALUES('74c8845e-80d5-4565-9980-c66859eaab6d','Use Taylor series, Maclaurin series, or known series representations and manipulations','משתמשים בטורי טיילור, טורי מקלורין, או ייצוגי טורים ידועים ומניפולציות');
INSERT INTO Translation VALUES('2e39102d-5949-476c-875e-c9b0878b6506','Only through differentiation','רק דרך גזירה');
INSERT INTO Translation VALUES('77d339cb-ba2f-4d91-b980-dfa8e145284c','All functions can be represented','כל הפונקציות ניתנות לייצוג');
INSERT INTO Translation VALUES('e9bf44f6-478c-47f6-9222-da25ddaa8f34','Only polynomial functions work','רק פונקציות פולינומיות עובדות');
